class Solution {

    /**
     * @param Integer[] $bills
     * @return Boolean
     */
    function lemonadeChange($bills) {
        $map = [5=>0,10=>0,20=>0];
        $flag = true;
        foreach ($bills as $num){
            $map[$num]+=1;
            if($num == 10){
                if($map[5]>0){
                    $flag = true;
                    $map[5]-=1;
                }else{
                    $flag = false;
                    break;
                }
            }elseif($num==20){
                if($map[5]>=1 && $map[10]>=1){
                    $flag = true;
                    $map[5]-=1;
                    $map[10]-=1;
                }elseif($map[5]>=3){
                    $flag = true;
                    $map[5]-=3;
                }else{
                    $flag = false;
                    break;
                }
            }
        }
        return $flag;
    }
}
